import React from "react";
import Title from "./comps/Title";
import UploadPhote from "./comps/UploadPhote";
import useFirestore from "./Hooks/useFirestore";

function App() {
  return (
    <div className="App">
      <Title />
      <UploadPhote />
      <useFirestore />
    </div>
  );
}

export default App;
